import React, { Component } from 'react';


const INITIAL_STATE = {
  username: '',
  email: '',
  picture: ''
}

class Account extends Component {
  constructor(props) {
    super(props);
    this.state = {...INITIAL_STATE };
  }



}

export default Account;
